import React from 'react';
import '../css/Form.css';
function Form(props) {
    return (
        <section className="form-section">
            <form className="form">
                <textarea
                type="text"
                name="content"
                id="content"
                className="content"
                placeholder="what is happening?">
                </textarea>
                <button className="btn" type="submit">twitter</button>
            </form>
        </section>
    );
}

export default Form;
